  "judgement": "sí",
  "continuation": "más que las alas mías, tan hermosas?\n¿Por qué, si el viento inclina tu firmeza,\nno te desarraiga como a mí, de prisa?\n¿Por qué mi juventud en tu corteza\nno deja ni el recuerdo de su risa?"
